import React from 'react';
import Products from'./Products';

const formatName=(user)=>{
  return user.firstName+" "+user.lastName;
}

const App=()=>{
  const user = {
    firstName:'Greg',
    lastName:'Lim',
    imageURL:'https://picsum.photos/200/300'
  };



  return(
    <div>
      <h1>
        Hello, {formatName(user)}
        <br/>
        <img src={user.imageURL}></img>
        <Products/>
        <Products/>
        <Products/>
      </h1>
    </div>
  )
}

export default App;
